import {  View, } from 'react-native';

export default function cartQuantity(cartItemNumber) {
    for(i=0; i>=0 ;i++) {
        cartItemNumber = cartItemNumber + i;
    };
    return(
        <View>
            {cartItemNumber}
        </View>
    );

}
